import MuiThemeProvider from '@material-ui/styles/MuiThemeProvider';
import { browserHistory } from 'react-router';
import withWidth, { LARGE, SMALL } from '@material-ui/utils/withWidth';

class App extends React.Component {
  render() {
    const menus = [
      { text: this.props.t('events'), icon: <Event color={iconColor} />, link: '/events' },
      { text: this.props.t('stations'), icon: <Station color={iconColor} />, link: '/stations' },
      {
        text: this.props.t('accounts'),
        icon: <PermIdentity color={iconColor} />,
        link: '/accounts',
      },
    ];
    return (
      <MuiThemeProvider muiTheme={Theme}>
        <div>
          <Header
            menus={menus}
          />

          <Container>
            {this.props.children}
          </Container>
        </div>
      </MuiThemeProvider>
    );
  }
}

export default withWidth()(PageLayout);
